const state = {
    robots: robots,
    searchfield: ''
}

const App = () => {
    return (
        <div className='tc'>
            <h1>RoboBuds</h1>
            <SearchBox />
            <CardList robots={robots} />
        </div>     
    ); 
}

export default App;
